import React from "react";
import "./Checkout.css";
//cartItems[index].id,
//cartItems[index].naziv,
//cartItems[index].kolicina,
//cartItems[index].slika,
//cartItems.cijena
export default function Checkout({ cartItems, setCartItems }) {
  return (
    <div className="backgroundDiv">
      <div className="topMargin"></div>
      {cartItems.map((item) => {
        return (
          <>
            <div className="itemCard">
              <img src={item.slika} className="itemSlika"></img>
              <div>
                <div className="nazivCheckout">
                  {item.naziv.length > 46
                    ? item.naziv.slice(0, 46) + "..."
                    : item.naziv}
                </div>
                <div>Cijena: {item.cijena}</div>
                <div> Kolicina: {item.kolicina}</div>
              </div>
            </div>
          </>
        );
      })}
    </div>
  );
}
